        }}
        onBlur={(event, editor) => {
          console.log("Blur.", editor);
        }}
        onFocus={(event, editor) => {
          console.log("Focus.", editor);
        }}
      />
      <button value="WOOSAH" onClick={handleClick([`ss`, `se`])}>hi</button>
    </div>
  );
}

export default test;
